        Google Books Search
      </a>
      <span>&nbsp;</span>
      <span>&nbsp;</span>
      <span>&nbsp;</span>
      <span>&nbsp;</span>
      <span>&nbsp;</span>
      <a className="navbar-brand" href="/saved">
        Your saved books
      </a>
    </nav>
  );
}

export default Nav;
